import React from 'react'

const WTCImage1 = () => {
    const images = [
    'https://t4.ftcdn.net/jpg/06/78/51/55/360_F_678515518_mBTG4aFYf8VCVWTL75PVaiMQhigbhhlY.jpg',
  ];
    return (
        <div>
             <img
                src={images}
                alt={'mg'}
                className="w-100 mb-5 "
                style={{
                  height: '300px',
                  objectFit: 'cover',
                }}
                />
        </div>
    )
}

export default WTCImage1
